  title: string;
  data: Ifilms[];
}

const Showdatas: FC<prop> = ({ title, data }) => {
  return (
    <div>
      <div className='Show-data'>
        <div className='Show-data-header'>
          <p>{title}</p>
        </div>
        <div className='Show-data-slide-div'>
          <div className='Show-slide'>{data.map((s) => console.log(s))}</div>
        </div>
      </div>
    </div>
  );
};

export default Showdatas;
